import React, {Component} from 'react';
import '../css/About.css';
import profile from '../assets/profile.png';

class About extends Component {
    render(){
      return (
        <div className="About">
            <div className="container">
                <div className="text">
                    <h2>About</h2>
                    <p>Medina is a skilled developer with an unwavering passion for the convergence of technology and
                        design. With a keen eye for detail and a deep understanding of user experience, she combines her
                        technical expertise with a creative mindset to craft innovative and intuitive digital solutions.
                        Medina's commitment to staying at the forefront of emerging technologies drives his constant pursuit
                        of knowledge and exploration. Whether she's developing sleek websites or crafting immersive mobile
                        applications, Medina's work reflects her dedication to delivering seamless user experiences and
                        pushing the boundaries of what's possible in the digital realm.</p>
                </div>

                <div className="image">
                    <img src={profile} alt="Profile" />
                </div>
            </div>
        </div>
      );
    }
  }


  export default About;
